export default function WalletsList(props){

  const displayWallets = (props) => {
    const {wallets} = props;
    if (wallets.length > 0){
      return(
        wallets.map((wallet) => {
          console.log(wallet);
          if(wallet.assets.length > 0){
            return(
              <div key={wallet.walletID}>
                <p>Wallet: {wallet.walletName}</p>
                <p>Balance: {wallet.assets[0].totalBalance.quantity}</p>
              </div>
            )
          }
        })
      )
    } else {
      return (<div>loading..</div>)
    }
  }

  return(
    <>
      {displayWallets(props)}
    </>
  )
};
